;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (temporal-distance id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle "Average temporal distance evolution"])]
      {:width 5 :height 5}))
